import React from "react";
// import "./HeaderArea.css";
import {FaYoutube} from 'react-icons/fa';
import {MdHome, MdSearch, MdVideoCall, MdViewComfy} from 'react-icons/md';
import {AiTwotoneBell} from 'react-icons/ai';
import { HiMicrophone } from "react-icons/hi";

function BottomNav() {
    return (
        <nav className="navbar navbar-expand-sm navbar-dark bg-dark fixed-bottom">
        <a className="navbar-brand" href="/">Tutlane</a>
        <ul className="navbar-nav">
            <li className="nav-item">
                <a className="nav-link" href="/"><MdHome color="blue" fontSize="1.5rem" /><br></br>Home</a>
            </li>
            <li className="nav-item">
                <a className="nav-link" href="/">Tutorials</a>
            </li>
            <li className="nav-item">
                <a className="nav-link" href="/">Articles</a>
            </li>
        </ul>
    </nav>
    );

}


export default BottomNav;
